export default function Main() {
  let [price, setPrice] = useState(0)
  
  return (
    <main className="container">
      The price: {price}
      <br/>
      <button onClick={() => setPrice(price + 1)} 
      className="btn btn-primary">  </button>
    </main>
  )
}
